#https://oj.leetcode.com/problems/regular-expression-matching/


class Solution():

    def returnStatus(self, status, cache, key):
        cache[key] = status
        return status

    def wildcardMatch(self, sPosition, string, rPosition, regex, cache):

        char = None
        match = None

        key = ("%d_%d")%(sPosition, rPosition)
        if key in cache:
            return cache[key]


        if sPosition == len(string) and rPosition == len(regex):
            # we consumed all
            return self.returnStatus(True, cache, key)

        if sPosition < len(string) and rPosition == len(regex):
            # consumed regex but not string
            return self.returnStatus(False, cache,key)

        if regex[rPosition] == '?':
            match = 'ANY'
        elif regex[rPosition] == '*':
            match = 'SEQ'
        else:
            match = 'CHAR'
            char = regex[rPosition]


        if match == 'ANY':
            if sPosition == len(string):
                return self.returnStatus(False, cache, key)

            # consume one char and recurse
            status = self.wildcardMatch(sPosition+1,string, rPosition+1, regex, cache)
            return self.returnStatus(status, cache, key)

        elif match == 'CHAR':
            if sPosition == len(string):
                return self.returnStatus(False, cache, key)
            # consume one char if matches and recurse
            if string[sPosition] == char:
                status = self.wildcardMatch(sPosition+1, string, rPosition+1, regex, cache)
                return self.returnStatus(status, cache, key)
            else:
                return self.returnStatus(False, cache, key)

        elif match == 'SEQ':
            if sPosition == len(string) and rPosition == len(regex)-1:
                # what is left out is only star regex
                return self.returnStatus(True, cache, key)
            if sPosition == len(string):
                status = self.wildcardMatch(sPosition, string, rPosition+1, regex, cache)
                return self.returnStatus(status, cache, key)

            # match zero chars and move regex
            status = self.wildcardMatch(sPosition, string, rPosition+1, regex, cache)
            if status:
                return self.returnStatus(status, cache, key)

            # match single char and not move regex
            status = self.wildcardMatch(sPosition+1, string, rPosition, regex, cache)
            return self.returnStatus(status, cache, key)




            # consume zero timess nad recurs

    def isMatch(self, s, p):
        cache = {}
        temp = p.replace("*","")
        if len(temp) > len(s):
            return False
        return self.wildcardMatch(0, s, 0, p, cache)

